import React from "react";
import styles from './experience.module.css';
import {
    Badge
  } from 'reactstrap';

const Experience = () => {
    return (
        <>
        <section id={styles.experienceContainer}>
            <div>
                <div>
                    <h1>Company Name</h1>
                    <Badge color="black" pill>
                    Internship
                    </Badge>
                </div>
                <div>
                    <h1>Positon</h1>
                    <h1>Date</h1>

                </div>

            </div>


        </section>

        </>
    )
}

export default Experience;
